import React, { Component } from "react";
import Typography from "@material-ui/core/Typography";

class Attributes extends Component {
  state = {};
  render() {
    return (
      <div>
        <Typography gutterBottom>Attributes</Typography>
      </div>
    );
  }
}

export default Attributes;
